    for(let i =1; i < parseInt(numberOfSets)+1;i++){
        generateNewWheelSet(raceID,i,cat,subcat)
    }
}


function generateNewWheelSet(raceID,setNr,cat,subcat){
    let cols = [];
    for (let i =0; i < 4; i++) {
        const idwheel = sendWheelRequest(0,'', '')
        cols.push(idwheel)
    }
    if (cols.length ==4) {
        const wheelsid = sendWheelsRequest(cols[0], cols[1], cols[2], cols[3], '')
        // sendNewSetRequest(raceID,setNr,cat,subcat,wheels)
        sendNewSetRequest(raceID,setNr,cat, subcat,wheelsid )
        //
    }
}

//generate one wheel and return id
async function sendWheelRequest(air_press = 0,id_scan='',id = '') {
   timeoutPromise(2000, fetch(
        'https://api.race24.cloud/wheel_cont/createWheel', {
            method: 'POST',
            headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({
                air_press:air_press,
                id_scan:id_scan,
                id:id,
            })
        })
        ).then(response => response.json()).then(
            data => {
                if (data[1]==200){
              console.log(data);
              return data[0].id;
              }
      }).catch(function (error) {
            console.log(error);
            return 0;
        })

}

